import classes from "./Orders.module.css";
import Card from "../UI/Card/LoginCard";

function OrderedItems(props) {
  return (
    <Card>
      <h3>{props.name} x {props.amount}</h3>
      <div className={classes.price}>{props.price}</div>
    </Card>
  );
}
export default OrderedItems;
